import React, { useState, useEffect } from 'react';
import { Link, useLocation } from 'react-router-dom';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isScrolled, setIsScrolled] = useState(false);
  const location = useLocation();

  useEffect(() => {
    const handleScroll = () => setIsScrolled(window.scrollY > 10);
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  // All page headings except WhatWeDo and OurThinking.
  const navItems = [
    { name: 'Home', path: '/' },
    { name: 'About Us', path: '/aboutus' },
    { name: 'Career', path: '/career' },
    { name: 'Contact', path: '/contact' },
    { name: 'Login', path: '/login' },
    { name: 'Projects', path: '/projects' },
    { name: 'Research', path: '/research' },
    { name: 'Who We Are', path: '/whoWeAre' },
    { name: 'Who We Serve', path: '/whoWeServe' }
  ];

  const styles = {
    // [styles same as your current code...]
  };

  const toggleMenu = () => setIsMenuOpen(!isMenuOpen);

  useEffect(() => {
    const style = document.createElement('style');
    style.textContent = `
      .nav-link-underline::after {
        content: '';
        position: absolute;
        bottom: 0;
        left: 0;
        width: 0;
        height: 2px;
        background: linear-gradient(135deg, #1e293b 0%, #334155 100%);
        transition: width 0.3s cubic-bezier(0.4, 0, 0.2, 1);
      }
      .nav-link-underline:hover::after,
      .nav-link-underline.active::after {
        width: 100%;
      }
      .nav-link-underline.active::after {
        background: linear-gradient(135deg, #1e293b 0%, #334155 100%);
      }
      @media (max-width: 768px) {
        .navbar-logo {
          height: 44px !important;
          max-width: 160px !important;
        }
      }
      @media (max-width: 480px) {
        .navbar-logo {
          height: 40px !important;
          max-width: 140px !important;
        }
      }
    `;
    document.head.appendChild(style);
    return () => {
      if (document.head.contains(style)) {
        document.head.removeChild(style);
      }
    };
  }, []);

  return (
    <nav style={styles.navbar}>
      <div style={styles.navContainer}>
        {/* Logo as Home link */}
        <Link
          to="/"
          style={styles.logoContainer}
          onMouseEnter={e => { e.currentTarget.style.transform = 'scale(1.05)'; }}
          onMouseLeave={e => { e.currentTarget.style.transform = 'scale(1)'; }}
        >
          <img
            src="/logo.jpg"
            alt="Logo"
            className="navbar-logo"
            style={{
              ...styles.logoImg,
              filter: 'drop-shadow(0 2px 8px rgba(0, 0, 0, 0.1))'
            }}
          />
        </Link>

        {/* Desktop Navigation */}
        <ul style={styles.navLinks}>
          {navItems.map(item => (
            <li key={item.path}>
              <Link
                to={item.path}
                className={`nav-link-underline ${location.pathname === item.path ? 'active' : ''}`}
                style={{
                  ...styles.navLink,
                  ...(location.pathname === item.path ? styles.activeLink : {})
                }}
                onMouseEnter={e => {
                  if (location.pathname !== item.path) {
                    e.target.style.color = '#1e293b';
                  }
                }}
                onMouseLeave={e => {
                  if (location.pathname !== item.path) {
                    e.target.style.color = '#374151';
                  }
                }}
              >
                {item.name}
              </Link>
            </li>
          ))}
        </ul>

        {/* Mobile Menu Button */}
        <button style={styles.mobileMenuButton} onClick={toggleMenu}>
          <div style={{
            ...styles.hamburgerLine,
            transform: isMenuOpen ? 'rotate(45deg)' : 'rotate(0)'
          }}></div>
          <div style={{
            ...styles.hamburgerLine,
            opacity: isMenuOpen ? 0 : 1,
            transform: isMenuOpen ? 'translateX(20px)' : 'translateX(0)'
          }}></div>
          <div style={{
            ...styles.hamburgerLine,
            transform: isMenuOpen ? 'rotate(-45deg)' : 'rotate(0)'
          }}></div>
        </button>

        {/* Mobile Menu */}
        <div style={styles.mobileMenu}>
          <div style={styles.mobileNavLinks}>
            {navItems.map(item => (
              <Link
                key={item.path}
                to={item.path}
                style={{
                  ...styles.mobileNavLink,
                  ...(location.pathname === item.path ? { color: '#1e293b', fontWeight: '600' } : {})
                }}
                onClick={() => setIsMenuOpen(false)}
                onMouseEnter={e => e.target.style.color = '#1e293b'}
                onMouseLeave={e => {
                  if (location.pathname !== item.path) {
                    e.target.style.color = '#374151';
                  }
                }}
              >
                {item.name}
              </Link>
            ))}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
